import React from 'react';
import './Header.css';
import logo from '../../'
'../assets/stackline-logo.svg';

const Header = () =>{
    <header className="header">
        <img src={logo} alt="Stackline logo"/>
        <h1>Shark Ninja</h1>
        <p>Magic Bullet NutriBullet 12-Piece High-Speed Blender/Mixer System</p>
    </header>
}
export default Header;
